import './App.css';
import Player from './Player'

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <video autoplay loop muted>
            <source src="https://assets.codepen.io/6093409/river.mp4" type="video/mp4" />
          </video>
          <Player />
      </header>
    </div>
  );
}

export default App;
